window.bookSummaryJSON = "<p>It's been three years Bethany Anne and her team have been building, trying their best to stay off the radar and not fight with those they are trying to save.</p> <p>The emotions have boiled to the surface.</p> <p>The is a line drawn in the sand, and some idiots just have to step across it.</p> <p>Those that thought the cat didn't have claws are about to find out how very, very wrong they are.</p> <p><b>Please note: As mentioned in a review, there is flagrantly foul language in these novels. The main character does not have a problem with cussing, just uninspired cussing.</b></p> <p>The Kutherian Gambit Series includes:</p> <ol> <li><i>Death Becomes Her</i></li> <li><i>Queen Bitch</i></li> <li><i>Love Lost</i></li> <li><i>Bite This</i></li> <li><i>Never Forsaken</i></li> <li><i>Under My Heel</i></li> <li><i>Kneel or Die</i></li> <li><i>We Will Build</i></li> <li><i>It's Hell to Choose</i></li> <li><i>Release The Dogs of War</i></li> <li><i>Sued for Peace</i></li> <li><i>We Have Contact</i></li> <li><i>My Ride Is a Bitch</i></li> <li><i>Don't Cross This Line</i></li> <li><i>Never Submit</i></li> </ol>"; 
